/* eslint-disable react/react-in-jsx-scope */
import { render, screen } from '@testing-library/react';
import { describe, it, expect } from 'vitest';
import { WeniLoveIcon } from './WeniLoveIcon';

describe('WeniLoveIcon Component', () => {
  it('should render the SVG with correct dimensions', () => {
    render(<WeniLoveIcon />);
    const svgElement = screen.getByRole('img', { hidden: true });
    expect(svgElement).toBeInTheDocument();
    expect(svgElement).toHaveAttribute('width', '86');
    expect(svgElement).toHaveAttribute('height', '91');
    expect(svgElement).toHaveAttribute('viewBox', '0 0 86 91');
  });

  it('should render the circle with correct properties', () => {
    render(<WeniLoveIcon />);
    const circleElement = screen.getByTestId('circle');
    expect(circleElement).toBeInTheDocument();
    expect(circleElement).toHaveAttribute('cx', '43');
    expect(circleElement).toHaveAttribute('cy', '41.1172');
    expect(circleElement).toHaveAttribute('r', '29.331');
    expect(circleElement).toHaveAttribute('fill', '#009E96');
    expect(circleElement).toHaveAttribute('stroke', '#00DED2');
    expect(circleElement).toHaveAttribute('stroke-width', '23.5723');
  });

  it('should render the rectangle with correct properties', () => {
    render(<WeniLoveIcon />);
    const rectElement = screen.getByTestId('rect');
    expect(rectElement).toBeInTheDocument();
    expect(rectElement).toHaveAttribute('x', '0.414307');
    expect(rectElement).toHaveAttribute('y', '5.45435');
    expect(rectElement).toHaveAttribute('width', '85.1713');
    expect(rectElement).toHaveAttribute('height', '85.1713');
    expect(rectElement).toHaveAttribute('fill', 'url(#pattern0)');
  });

  it('should render the pattern with correct dimensions', () => {
    render(<WeniLoveIcon />);
    const patternElement = screen.getByTestId('pattern');
    expect(patternElement).toBeInTheDocument();
    expect(patternElement).toHaveAttribute('width', '1');
    expect(patternElement).toHaveAttribute('height', '1');
    expect(patternElement).toHaveAttribute('id', 'pattern0');
  });

  it('should render the image with correct properties', () => {
    render(<WeniLoveIcon />);
    const imageElement = screen.getByTestId('image');
    expect(imageElement).toBeInTheDocument();
    expect(imageElement).toHaveAttribute('width', '420');
    expect(imageElement).toHaveAttribute('height', '420');
    expect(imageElement).toHaveAttribute(
      'href',
      'data:image/png;base64,',
    );
  });
});
